import React, { ChangeEvent, InputHTMLAttributes } from "react";
import InputValue from "../input";

interface ChangeProps {
  ChangePropsHandler: (
    event: ChangeEvent<InputHTMLAttributes<HTMLInputElement>>
  ) => void;
  id: "salary";
  type: "number";
  disabled: { false };
  text: "Sal√°rio Bruto";
}

const Salary: React.FC<ChangeProps> = ({ ChangePropsHandler }) => {
  return (
    <div className="col s12">
      <div className="input-field col s12">
        <InputValue ChangeHandler={ChangePropsHandler} />
      </div>
    </div>
  );
};

export default Salary;
